import React from 'react';
import {Grid} from "@mui/material";
import useStyles from "./Portfolio.style";
import {
    img1,
    img2,
    img3,
    img4,
    img5,
    img6
} from "../../ResumeData/portfolio/images"
function ImageHoverHandler(e, MouseEv) {
    const styles = useStyles();

    if(MouseEv === 'enter'){

        e.target.className =  e.target.className + '  ' + styles.ImageHovered;
    }else{
        e.target.className =  e.target.className.replace(styles.ImageHovered , '')

    }
}

function ImageJsx(image) {

    const styles = useStyles();

    return (
        <div className={styles.imageContainer}>

            <img
                onMouseEnter={(event) => ImageHoverHandler(event, 'enter')}
                onMouseLeave={(event) => ImageHoverHandler(event, 'leave')}
                src={image}
                alt={'image'}
            />

        </div>
    );
}

function Portfolio(data) {
    const styles = useStyles();
    return (
        <Grid className={'flex-row '} container>
            <Grid className={'flex-row d-flex'} item xs={12}>
                <Grid item xs={4}>
                    <div className="">
                        {ImageJsx(img1)}
                    </div>
                    <div className="">
                        {ImageJsx(img2)}
                    </div>
                </Grid>
                <Grid className={styles.ImagesMiddle} item xs={4}>
                    <div className="">
                        {ImageJsx(img3)}
                    </div>
                    <div className="">
                        {ImageJsx(img4)}
                    </div>
                </Grid>
                <Grid item xs={4}>
                    <div className="">
                        {ImageJsx(img5)}
                    </div>
                    <div className="">
                        {ImageJsx(img6)}
                    </div>
                </Grid>
            </Grid>
        </Grid>
    );
}

export default Portfolio;
